css:
:root {
  font-size: 16px;
}
.tree-view-resizer {
  position: relative;
  height: 100%;
  overflow: hidden;
  cursor: default;
  -webkit-user-select: none;
  min-width: 100px;
  width: 200px;
  z-index: 2;
  display: flex;
  flex-direction: column;
}
.tree-view-resizer > .order--start {
  order: -10;
}
.tree-view-resizer > .order--center {
  order: 0;
}
.tree-view-resizer > .order--end {
  order: 10;
}
.tree-view-resizer .tree-view-resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  width: 10px;
  cursor: col-resize;
  z-index: 3;
}
.tree-view-resizer[data-show-on-right-side='true'] .tree-view-resize-handle {
  left: -5px;
}
.tree-view-resizer[data-show-on-right-side='false'] .tree-view-resize-handle {
  right: -5px;
}
.project-root-header {
  -webkit-user-drag: element;
}
.tree-view-scroller {
  display: flex;
  flex-direction: column;
  flex: 1;
  width: 100%;
  overflow: auto;
}
.tree-view {
  flex-grow: 1;
  flex-shrink: 0;
  /*
   * Force a new stacking context to prevent a large, duplicate paint layer from
   * being created for tree-view's scrolling contents that can make the cost of
   * layer tree updates scale at 3x the size of the layer rather than the
   * optimal 1x.
   *
   * On high resolution displays, Chromium handles layers for scrolling content
   * differently and inadvertently creates a duplicate paint layer the size of
   * .tree-view-scroller because descendants of the scroller overlap the
   * auto-created layer.
   */
  isolation: isolate;
  min-width: -webkit-min-content;
  min-height: 100%;
  padding-left: 0.25rem;
  padding-right: 0.5rem;
  position: relative;
  /* Drag and Drop */
}
.tree-view .header {
  position: relative;
}
.tree-view .list-tree {
  position: static;
}
.tree-view .entry::before {
  content: '';
  position: absolute;
}
.tree-view .placeholder {
  position: absolute;
  left: 0.25rem;
  padding: 0;
  z-index: 999;
  display: inline-block;
  width: calc(100% - 0.25rem);
  background: #9acffa;
  list-style: none;
  pointer-events: none;
}
.tree-view .placeholder:before {
  content: "";
  position: absolute;
  height: 2px;
  margin: -1px;
  padding: 0;
  width: inherit;
  background: inherit;
}
.tree-view .placeholder:after {
  content: "";
  position: absolute;
  left: 0;
  margin-top: -2px;
  margin-left: -1px;
  width: 4px;
  height: 4px;
  background: #9acffa;
  border-radius: 4px;
  border: 1px solid transparent;
}
.tree-view .placeholder:first-child {
  margin-top: 1px;
}
.platform-win32 .tree-view-resizer .tree-view-resize-handle {
  cursor: ew-resize;
}
